import React from 'react'

const TopIcons = () => {
  return (
    <div
      style={{
        color: "white",
        backgroundColor: "black",
        height: "35px",
        display: "flex",
        opacity: "0.9",
      }}
    >
      <img
        src={"https://pngimg.com/uploads/apple_logo/apple_logo_PNG19677.png"}
        style={{
          width: "25px",
          marginLeft: "1.9%",
          marginTop: "3.25px",
          height: "27px",
        }}
      />

      <div style={{ marginLeft: "5%", marginTop: "5px", fontWeight: "bold",justifyContent:"space-between" }}>
        <button>
          <p style={{fontWeight:"bold"}}>F I L E</p>
        </button>
        <button><p style={{fontWeight:"bold"}}>E D I T</p></button>
        <button><p style={{fontWeight:"bold"}}>H E L P</p></button>
      </div>
    </div>
  );
}

export default TopIcons
